import Vue from 'vue';
import Router from 'vue-router';
import HomePage from '../views/HomePage.vue';
import LoginPage from '../views/LoginPage.vue';
import Cars from '../views/Cars.vue';
import AboutUs from '../views/AboutUs.vue';  // Проверете дали е правилно импортирано

Vue.use(Router);

export default new Router({
  mode: 'history',  // Овој режим ги отстранува # од URL-то
  routes: [
    { path: '/', component: HomePage },      // Рута за HomePage
    { path: '/login', component: LoginPage }, // Рута за LoginPage
    { path: '/cars', component: Cars },      // Рута за Cars
    { path: '/about_us', component: AboutUs } // Рута за AboutUs
  ]
});
